import React from 'react'
import './Header.css'
const Header = () => {
    return (
        <header className='header'>
        <div>
          <img src='https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/portrait-of-cat-sitting-on-sofa-at-home-royalty-free-image-1574708553.jpg?crop=0.668xw:1.00xh;0.167xw,0&resize=640:*' />
        </div>
      </header>
    );
}
export default Header;
